description:
Dr. Grey is a new resident at ZZ hospital but luckily for her, Dr. Brookes is there to show her the ropes: specifically, how to keep unruly patients happy (while at the same time getting some respite from the stress of being a doctor.) To demonstrate, Dr. Brookes fucks patient Danny D.


